import { Component } from '@angular/core';
import { GlobalData } from '../../shared/utils/data';

@Component({
  selector: 'app-predict',
  templateUrl: './predict.component.html',
  styles: [],
})
export class PredictComponent {
  data: any = GlobalData;
}
